import React from 'react';
import routes from './routes'; // Importing the routes function from routes.js

const Dashboard = () => {
  // Fetching routes
  const userRoutes = routes();

  return (
    <div>
      {/* Rendering the routes */}
      {userRoutes.map((route, index) => (
        <div key={index}>
          <p>Path: {route.path}</p>
          <p>Name: {route.name}</p>
          {/* Add rendering for other route properties */}
        </div>
      ))}
    </div>
  );
};

export default Dashboard;
